INSERT INTO `business_processes` VALUES (1,'Strategieprozess',3,NULL,'7','Unternehmensführung','1',2,'Unternehmenserfolg (Erlös und Fortbestand)',1,'h3. Strategie\r\n\r\n* Planung \r\n** nötiger Umsatz auf Basis Kosten\r\n** Leistungen \r\n** Kunden\r\n** Weiterbildung\r\n** Personal\r\n\r\n(inkl. Finanzplanung) --> Anf. GJ\r\n\r\nZusätzlich zu den SOLL-Grenzen werden Warngrenzen (SOLL + 10 %)- und Eingriffsgrenzen (SOLL + 3%) definiert \r\n\r\n* Freigabe\r\n\r\nh3. Monitoring + Reporting\r\n\r\n* am Quartalsende SOLL - IST-Vergleich \r\n\r\nh4. Maßnahmen\r\n\r\n* --> bei Unterschreitung der Warngrenze --> Vorbeugungsmaßnahme\r\n* --> bei Unterschreitung der Eingriffsgrenze --> Korrekturmaßnahme\r\n\r\n','2012-10-02 14:20:36','2013-06-06 11:47:14',46,25,NULL,NULL,NULL),(3,'der MC-Components GmbH.',1,NULL,NULL,'','',NULL,'',1,'','2012-10-03 14:31:23','2012-10-13 15:18:44',NULL,NULL,NULL,2,''),(4,'Finanzen',3,NULL,'7','ges. Finanzmanagement sicherstellen','',2,'Liquidität sicherstellen, Unternehmensfortbestand sichern',9,'Finanzplanung (Bedarf)\r\nLiquiditätsplanung\r\nRechnungswesen \r\nMahnwesen\r\nSteuerberater\r\nFinanzamt / Behörden','2012-10-04 06:42:23','2013-06-06 11:47:16',250,25,NULL,NULL,NULL),(5,'Ressourcen',3,NULL,'7','Sicherstellung der Verfügbarkeit aller nötigen Ressourcen','',2,'alloe nötigen Ressourcen sind verfügbar bzw. die Planung und Beschaffung dieser Ressourcen ist klargstellt',1,'*Personelle Ressourcen*\r\n * Rekrutierung\r\n * Anstellung\r\n * Beschäftigung \r\n * Aus- und Weiterbildung\r\n * Beendigung der Beschäftigung\r\n\r\n*Sachressourcen*\r\n * Planung\r\n * Anschaffung\r\n * Verwendung\r\n * Instandhaltung\r\n * Beendigung der Verwendung / Ausscheiden\r\n\r\n*Infrastruktur / Arbeitsumgebung*','2012-10-04 06:46:58','2013-06-06 11:47:22',450,25,NULL,NULL,NULL),(6,'Beratungs- und Dienstleistungsangebot',3,NULL,'7','Sicherstellung der einwandfreien Erbringung der Beratungs- und Dienstleistungen zur völligen Kundenzufriedenheit und wirtschaftlich erfolgreichen Unternehmensführung','2.1',2,'Gewinn erwirtschaften',2,'1) Kundenakqisition\r\n2) Angebote\r\n3) Auftragsabwicklung\r\n4) ','2012-10-04 06:51:07','2013-06-06 11:47:21',250,150,NULL,2,'Leistungserbringung'),(7,'der Ing. Walter Kalcher Qualitätsmanagement',3,NULL,NULL,'Grafische Darstellung der gesamten Unternehmenstätigkeit','1',2,'zertifizierung nach ISO 9001:2008',1,'','2012-10-04 06:52:42','2012-10-13 15:10:58',525,200,NULL,2,'ges. Unternehmen'),(8,'Angebot',3,NULL,'7/6','Klarstellung der Angebotserstellung','123',2,'richtige Angebote legen und hohe Auftragswahrscheinlichkeit herstellen ',2,'','2012-10-04 06:55:24','2013-02-24 16:34:51',475,250,NULL,1,'Gültigkeitsbereich'),(10,'Prozess 1',3,NULL,'7','','',1,'',3,'','2012-10-04 07:21:48','2013-06-06 11:47:27',450,225,NULL,NULL,NULL),(11,'Prozess 2',3,NULL,'7/6','','',2,'',2,'','2012-10-04 07:22:06','2013-02-24 16:35:04',475,375,NULL,NULL,NULL),(13,'Prozess 4',3,NULL,NULL,'','',NULL,'',4,'','2012-10-04 07:22:42','2012-10-04 07:22:42',NULL,NULL,NULL,NULL,NULL),(14,'Auftrag',3,NULL,'7/6','','',2,'',2,'','2012-10-04 07:32:47','2013-02-24 16:34:53',625,250,NULL,NULL,NULL),(15,'Beschaffung',3,NULL,'7/6','','',2,'',2,'','2012-10-04 07:33:24','2013-02-24 16:35:02',775,325,NULL,NULL,NULL),(16,'Kommissionierung',3,NULL,'7/6','','',2,'',2,'','2012-10-04 07:33:49','2013-02-24 16:34:56',775,250,NULL,NULL,NULL),(17,'Lieferung',3,NULL,'7/6','','',2,'',2,'','2012-10-04 07:34:11','2013-02-24 16:34:58',975,250,NULL,NULL,NULL),(18,'Fakturierung + Dokumente',3,NULL,'7/6','','',2,'',2,'','2012-10-04 07:34:36','2013-02-24 16:35:00',1125,250,NULL,NULL,NULL),(19,'Reklamationen',3,NULL,'7','','',2,'',4,'','2012-10-04 07:35:07','2013-06-06 11:47:33',600,300,NULL,NULL,NULL),(20,'KVP ',3,NULL,'7','','',2,'',4,'','2012-10-04 07:35:44','2013-06-06 11:47:30',250,300,NULL,2,''),(21,'Korrekturmaßnahmen',3,NULL,'7/20','','',2,'',4,'','2012-10-04 07:36:09','2012-10-04 07:39:35',525,425,NULL,NULL,NULL),(22,'Vorbeugungsmaßnahmen',3,NULL,'7/20','','',2,'',4,'','2012-10-04 07:36:31','2012-10-04 07:39:36',825,425,NULL,NULL,NULL),(23,'Verbesserung',3,NULL,'7/20','','',2,'',4,'','2012-10-04 07:36:51','2012-10-04 07:39:38',1150,425,NULL,NULL,NULL),(24,'Audit',3,NULL,'7','','',2,'',4,'','2012-10-04 07:37:14','2013-06-06 11:47:32',450,300,NULL,NULL,NULL),(25,'Datenanalyse',3,NULL,'7','','',2,'',4,'','2012-10-04 07:37:38','2013-06-06 11:47:29',50,300,NULL,NULL,NULL),(26,'QM-System',3,NULL,'7','','',2,'',3,'','2012-10-04 07:38:04','2013-06-06 11:47:26',250,225,NULL,NULL,NULL),(27,'Aus- unsd Weiterbildung',3,NULL,'7','','',2,'',3,'','2012-10-04 07:38:28','2013-06-06 11:47:24',50,225,NULL,NULL,NULL),(28,'Strategische  Unternehmenführung',1,NULL,'3','Gesunder Wachstum des Unternehmens sichern','',8,'',5,'','2012-10-04 15:35:18','2013-06-06 11:47:04',25,25,NULL,NULL,NULL),(29,'Finanzprozess',1,NULL,'3','Sicherstellung der Liquititä','',8,'',5,'','2012-10-04 15:37:19','2013-06-06 11:47:05',225,25,NULL,NULL,NULL),(30,'Vertriebsprozess',1,NULL,'3','Termingetreue und Fehlerfreie lieferung der Produkte','',9,'',6,'','2012-10-04 15:42:17','2013-06-06 11:47:07',125,100,NULL,NULL,NULL),(31,'Angebot',1,NULL,'3/30','','',NULL,'',6,'','2012-10-04 15:45:24','2012-10-04 15:45:24',NULL,NULL,NULL,NULL,NULL),(32,'Tätigkeit für die Quality Austria',3,NULL,'7','Einwandfreie Durchführung und Erfüllung der Aufträge der Quality Austria ','1.1',2,'termingerechte und richtige Erfüllung der Aufträge der Quality Austria',2,'1. Beauftragung durch QA (via WIS)\r\n2. Terminkoordination mit dem Kunden\r\n3. Terminrückmeldung an QA (im WIS)\r\n4. Auditprogramm erstellen\r\n5. Auditmappe erstellen (gem. WIS)\r\n6. Audit durchführen\r\n7. Auditbericht erstellen\r\n8. relevante Dokumente ins WIS hochladen\r\n9. Auditunterlagen archivieren \r\n--------------------------------------------------------------\r\n1. Beauftragung durch QA\r\nINPUT = E-Mail und Datensatz im WIS ca. 4 Monate vor dem Audit-Solltermin\r\nIn der \"Beauftragung\" und dem \"Kundenstammblatt\"   sind alle relevanten Unternehmensinfos enthalten. \r\n\r\n2. Terminkoordination mit dem Kunden\r\nMit dem Kunden ist umgehend Kontakt aufzunehmen und ein Termin zu finden (zumindest auf die Woche eingeschränkt). Das Stammdatenblatt muss mitgesendet und zurück gefordert werden.\r\nWeiters sind seine Auditwünsche zu erheben (bzw. zumindest ihn darauf hinzuweisen)\r\n\r\n3. Terminrückmeldung an QA (im WIS)\r\nDer vom Kunden genannte Termin ist ins WIS einzutragen (+ alle weiters geforderten Informationen -> CO-Auditor, Beobachter, Kundenstammblatt)\r\n\r\n4. Auditprogramm erstellen\r\nCa. 4 Wochen vor dem Audit ist das Auditprogramm zu erstellen und dem Kunden zu senden (Auditpartner eintragen, Änderungen /  Ergänzungen usw)\r\n\r\n5. Auditmappe erstellen (gem. WIS)\r\nIm WIS bereitgestellte Auditdokumente ausdrucken und in der Auditmappe je register ablegen\r\nAuditcheckliste ninden und ebenfalls in Auditmappe einordnen.\r\nSchreibunterlagen + Visitenkarten mitnehmen (rote QA-Tasche)\r\n\r\n6. Audit durchführen\r\ngem. Regelungen der QA\r\n\r\n7. Auditbericht erstellen\r\nInnerhalb von 2 Wochen muss der Auditbericht erstellt werden.\r\n\r\n8. relevante Dokumente ins WIS hochladen\r\nje Auditart im WIS upzuloadente Dokumente erstellen, einscannen und uploaden\r\n\r\n9. Auditunterlagen archivieren \r\nAblage aller papierdokum,ente im Kundenordner (gelb).\r\n \r\n\r\n\r\n','2012-10-13 15:20:54','2013-06-06 11:47:20',250,75,2,1,'Consulting'),(33,'orlik',3,NULL,'7/1','test','',NULL,'',2,'','2013-02-25 11:18:44','2013-02-25 11:18:44',NULL,NULL,2,2,''),(34,'simplifizierter Angebotsverlauf',3,NULL,NULL,'','',NULL,'',2,'','2013-03-20 06:20:57','2013-03-20 06:20:57',NULL,NULL,1,1,'');
