INSERT INTO `news` VALUES (1,'News bei der Anmeldung dargestellt','Beim Einloggen werden Neuigkeiten zu allen Änderungen dargestellt, die seit der letzten Anmeldung stattgefunden haben.\r\n\r\n_Sie werden übrigens nach einer Stunde automatisch abgemeldet, sollten Sie nicht auf den [Abmelden]-Link klicken._',1,NULL,'2012-10-09 09:14:53','2012-10-09 09:14:53'),(2,'Layout','* Modernere Schriftarten und kleinere Elemente erhöhen die Lesbarkeit.\r\n* Das Menü zeigt nun den gewählten Menüpunkt.\r\n* Klick auf den Titel @Qm.mittenin.at@ bringt die Benutzer zur Startseite',1,1,'2012-10-10 07:14:15','2012-10-10 07:19:28'),(3,'Zeitzone','Bislang erfolgte die Darstellung von Daten in UTC (universal time coordinated).\r\n\r\nAb jetzt erfolgt die korrekte Darstellung als MEZ (Mitteleuropäische Zeit )bzw. MESZ (Mitteleuropäische Sommerzeit).',1,1,'2012-10-11 14:35:00','2012-10-11 14:35:00'),(4,'Erweiterung Geschäftsprozess','Geschäftsprozesse wurden um folgende Felder erweitert:\r\n* Autor (automatisch aus dem angemeldeten User)\r\n* Geltungsbereich\r\n* Geschäftsprozesse werden ab jetzt versioniert: Die Versionen können in der Registerkarte [Versionen] eingesehen werden.\r\n* Versionsunterschiede werden farblich gekenzeichnet: \r\n** grün: Text ist neu hinzugekommen, bzw. Neuer Eintrag\r\n** rot: Text wurde entfernt, bzw.: Alter Eintrag \r\n',1,1,'2012-10-11 14:36:17','2013-02-21 17:01:24'),(5,'Fehler im Berechtigungswesen','...behoben. Leider einer, der sogar die Anmeldung scheitern ließ.',1,1,'2012-10-18 13:25:42','2012-10-18 13:25:42'),(6,'Update 19. Februar 2013','h1. Prozessschritte \r\n\r\n* Prozessschritte können nun angelegt und Prozessen zugeordnet werden ( Es gibt noch keine Vorgänger - Nachfolger Relation und keine graphische Darstellung, das folgt als Nächstes.)\r\n* Prozessschritte habe einen Typ, genannt BPMN Objekt Typ. Dieser wird zur Visualisierung und für die Kontrolle der Abläufe verwendet werden. So wird ein Schritt vom Typ \"Ende\" keinen Nachfolger haben können, etc.\r\n* Momentan gibt es die Flow Objekte [Start], [Ende] und [Task]. Weitere werden folgen.\r\n\r\nh1. Bugfixes\r\n\r\nEinige kleinere Bugfixes gab es im Bereicht Layout: \r\n* Alle Textbeschriftungen auf Buttons weisen ausreichenden Kontrast auf.\r\n* Die Schriftarten und Farben sind nun einheitlich.\r\n* Im Texteditor erscheint die Buttonleiste nicht mehr doppelt.\r\n* Ein Fehler in der Darstellung der Versionierungsinformationen wurde behoben.',1,1,'2013-02-19 15:12:04','2013-02-19 15:12:04'),(7,'Update 20.Februar 2013','h1. Nachfolgerelationen in Prozessen\r\n\r\n* Prozessschritte können nun furch BPMN Sequenflüsse verbunden werden - einfach als \"Pfeile zwischen den Kasterln\" zu veranschalulichen.\r\n* Dazu verwenden Sie im Menü [Prozesse] den Menüpunkt [BPMN Sequenzflüsse]. Eine intuitivere Eingabemöglichkeit und Visualisierung wird folgen.\r\n* Damit haben Prozessschritte Vorgänger und Nachfolger. ',1,1,'2013-02-20 10:28:12','2013-02-20 10:28:12'),(8,'Update 21.Februar 2013','Alle Index-Ansichten (Listen von Objekten)  sind nun komfortabler: \r\nSuche, Filterung, Anzahl der Einträge pro Seite und Sortierung sind ohne Reload der Seite durchführbar.',1,1,'2013-02-21 16:57:43','2013-02-21 16:58:11'),(9,'Update 22.Februar 2013','* Alle Statusmeldungen sind jetzt ins Deutsche übersetzt.\r\n* Bei der Useranlage können nun bereits Funktionen, Rollen, etc. zugeordnet werden, ohne dass es zu einer Fehlermeldung kommt.\r\n* Die Übersetzung der Sperrmeldungen ist teilweise erledigt.',1,1,'2013-02-22 09:13:33','2013-02-22 21:51:47'),(10,'Update 24.Februar 2013','h1. Berechtigungswesen\r\n\r\n* Benutzer sehen nun nur mehr die Links der Aktionen, die sie auch ausführen dürfen\r\n* Qualitätsmanager können Personen in allen Firmen anstellen, in denen sie selbst angestellt sind\r\n* Qualitätsmanager können andere Personen zu Qualitätsmanagern machen\r\n\r\n',1,1,'2013-02-24 07:10:33','2013-02-24 07:25:17'),(11,'Update 3.März 2013','h1. Neue Features \r\n\r\n *  Arbeitsanweisungen und Aufzeichnungen können  ab jetzt Prozessschritten zugeordnet werden.',1,1,'2013-03-03 10:28:37','2013-03-09 07:38:50'),(12,'Update 9.März','h1. Neues Feature\r\n\r\n* Dokumente können ab jetzt Arbeitsanweisungen und Prozessschritten zugeordnet werden\r\n',1,1,'2013-03-09 07:37:47','2013-03-09 18:55:48');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

