INSERT INTO `notes` VALUES (1,'Tätigkeits- und Zeitbestätigung',3,'Beim Kunden geleistete Tätigkeiten müssen aufgezeichnet und vom Kunden quittiert werden.\r\nDiese Tätigkeits- und Zeitbestätigung dient als Grundlage für die Fakturierung der Leistung','2012-10-02 14:27:00','2012-10-02 17:29:46',NULL,NULL,NULL,NULL),(2,'Angebot',3,'Erstellte Angebote\r\nMedium: WORD-Dokument\r\nAblage: elektron --> gespeichert Pfad........in Papierform -> Kundenakt\r\nAufbewahrungsdauer: 7 Jahre (+ Kalenderjahr des Entstehens)\r\n\r\n','2012-10-02 17:35:30','2012-10-02 17:35:30',NULL,NULL,NULL,NULL),(3,'Auftragsbestätigung',3,'Erstellte Auftragsbestätigung\r\nMedium: WORD-Dokument\r\nAblage: elektron --> gespeichert Pfad........in Papierform -> Kundenakt\r\nAufbewahrungsdauer: 7 Jahre (+ Kalenderjahr des Entstehens)\r\n\r\n','2012-10-02 17:35:57','2012-10-02 17:36:59',NULL,NULL,NULL,NULL),(4,'Rechnung',3,'Erstellte Rechnungen\r\nMedium: WORD-Dokument\r\nAblage: elektron --> gespeichert Pfad........in Papierform -> Kundenakt\r\nAufbewahrungsdauer: 7 Jahre (+ Kalenderjahr des Entstehens)\r\n\r\n','2012-10-02 17:37:19','2012-10-02 17:37:19',NULL,NULL,NULL,NULL),(5,'QA-Auditcheckliste',3,'Durch den Upload im WIS ist grundsätzlich eine eigene Archivierung nicht erforderlich.\r\nTrotzdem wird die Auditcheckliste elektronisch und in papierform archiviert.\r\nElektronisch im Verzeichnis C/DATEN/1Qualityaustria/Audits im Kundenordner im jeweiligen Uploadjahr\r\nIn Papier wird die Auditcheckliste im gelben Kundenordner abgelegt.\r\n','2012-10-02 17:39:15','2013-02-18 16:10:27','3 Jahre','Kundenordner / elektronisch intern / elektronisch extern ','Daten / Papier','JA'),(6,'QA-Auditprogramm',3,'Durch den Upload im WIS ist grundsätzlich eine eigene Archivierung nicht erforderlich.\r\nTrotzdem wird das Auditprogramm elektronisch und in papierform archiviert.\r\nElektronisch im Verzeichnis C/DATEN/1Qualityaustria/Audits im Kundenordner im jeweiligen Uploadjahr\r\nIn Papier wird das Auditprogramm im gelben Kundenordner abgelegt. ','2013-02-18 16:00:55','2013-02-18 16:00:55','3 jahre','Kundenordner / elektronisch intern / elektronisch extern ','Daten / Papier','JA'),(7,'QA-Auditbericht',3,'Durch den Upload im WIS ist grundsätzlich eine eigene Archivierung nicht erforderlich.\r\nTrotzdem wird der Auditbericht elektronisch und in papierform archiviert.\r\nElektronisch im Verzeichnis C/DATEN/1Qualityaustria/Audits im Kundenordner im jeweiligen Uploadjahr\r\nIn Papier wird der Auditbericht im gelben Kundenordner abgelegt.\r\n\r\n','2013-02-18 16:04:21','2013-02-18 16:05:49','3 Jahre','Kundenordner / elektronisch intern / elektronisch extern ','Daten / Papier','JA'),(8,'QA-Auditbestätigung',3,'Durch den Upload im WIS ist grundsätzlich eine eigene Archivierung nicht erforderlich.\r\nTrotzdem wird die Auditbestätigung elektronisch und in papierform archiviert.\r\nElektronisch im Verzeichnis C/DATEN/1Qualityaustria/Audits im Kundenordner im jeweiligen Uploadjahr\r\nIn Papier wird die Auditbestätigung im gelben Kundenordner abgelegt.\r\n','2013-02-18 16:06:41','2013-02-18 16:07:53','3 Jahre','Kundenordner / elektronisch intern / elektronisch extern ','Daten / Papier','JA');
