INSERT INTO `process_classes` VALUES (1,'Management',3,'Prozesse, die zum Führen, Steuern und Lenken des Unternehmens dienen.','2012-10-02 14:15:09','2012-10-04 07:11:54','rot'),(2,'Wertschöpfung',3,'Diese Prozesse beginnen in der Regel beim Kunden und enden wieder beim Kunden. Der Anstoß kommt vom Kunden (Bedarf) und endet mit der Lieferung der Unternehmensleistung (Produkt und/oder Dienstleistung). Daher werden diese PÜrozesse auch END TO END-Prozesse genannt.\r\n+*Mit diesen Prozessen verdient das Unternehmen Geld.*+','2012-10-02 14:15:33','2012-10-04 07:12:07','blau'),(3,'Unterstützung',3,'Diese Prozesse unterstützen / ermöglichen die Wertschöfungsprozesse, sind selbst jedoch alleine nicht wertschöpfend,','2012-10-02 14:15:41','2012-10-04 07:12:16','schwarz'),(4,'Verbesserung',3,'Prozesse die der Verbesserung der ges. Unternehmensleistung dienen.\r\nAuffinden von Potential (Monitoring, Reporting), Ursachenforschung, Maßnahmensetzung, Wirksamkeitsprüfung','2012-10-02 14:15:55','2012-10-04 07:12:24','gruen'),(5,'Führungsprozesse',1,'Alle Prozesse, die zum leiten und lenken des Unternehmens nötig sind.','2012-10-04 05:31:32','2012-10-04 11:39:48','rot'),(6,'Leistungsprozesse',1,'Alle Prozesse, die zum Erfüllen von Kundenanforderungen nötig sind (auch Teilprozesse davon).','2012-10-04 05:33:11','2012-10-04 11:39:58','blau'),(7,'Supportprozesse',1,'Diese Prozesse unterstützen / ermöglichen die Wertschöfungsprozesse, sind selbst jedoch alleine nicht wertschöpfend,','2012-10-04 05:33:43','2012-10-04 11:40:07','schwarz'),(8,'Messung, Analyse, Verbesserung',1,'Alle Prozesse, die die Unternehmensleistung messen, analysieren und verbessern','2012-10-04 05:34:39','2012-10-04 11:40:16','gruen'),(9,'ausgelagerte Prozesse',3,'Unternehmenstätigkeiten die extern vergeben werden, wenn diese auch intern durchgeführt werden könnten (zB. auch Kapazitätsgründen) ','2012-10-10 07:24:09','2012-10-10 07:24:09','gelb');
