Quality Austria\"\ncompany_id: 3\nparent_id: \nancestry: \"7\"\npurpose: \"Einwandfreie Durchf\\xC3\\xBChrung und Erf\\xC3\\xBCllung der Auftr\\xC3\\xA4ge der Quality Austria \"\nnumber: \"\"\nowner_id: 2\naims: \"\"\nprocess_class_id: 2\ndescription: \"\"\ncreated_at: 2012-10-13 15:20:54 Z\nupdated_at: 2012-10-13 15:27:10 Z\nx: 650\ny: 250\ncreated_by: 2\nupdated_by: 2\narea: \"\"\nid: 32\n','2013-02-18 15:27:58','--- !map:ActiveSupport::HashWithIndifferentAccess \nnumber: \n- \"\"\n- \"1.1\"\narea: \n- \"\"\n- Consulting\naims: \n- \"\"\n- \"termingerechte und richtige Erf\\xC3\\xBCllung der Auftr\\xC3\\xA4ge der Quality Austria\"\ndescription: \n- \"\"\n- \"1. Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  9. Auditunterlagen archivieren \"\n'),(112,'BusinessProcess',32,'update','2','--- \nname: \"T\\xC3\\xA4tigkeit f\\xC3\\xBCr die Quality Austria\"\ncompany_id: 3\nparent_id: \nancestry: \"7\"\npurpose: \"Einwandfreie Durchf\\xC3\\xBChrung und Erf\\xC3\\xBCllung der Auftr\\xC3\\xA4ge der Quality Austria \"\nnumber: \"1.1\"\nowner_id: 2\naims: \"termingerechte und richtige Erf\\xC3\\xBCllung der Auftr\\xC3\\xA4ge der Quality Austria\"\nprocess_class_id: 2\ndescription: \"1. Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  9. Auditunterlagen archivieren \"\ncreated_at: 2012-10-13 15:20:54 Z\nupdated_at: 2013-02-18 15:27:58 Z\nx: 650\ny: 250\ncreated_by: 2\nupdated_by: 2\narea: Consulting\nid: 32\n','2013-02-18 15:53:04','--- !map:ActiveSupport::HashWithIndifferentAccess \ndescription: \n- \"1. Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  9. Auditunterlagen archivieren \"\n- \"1. Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  9. Auditunterlagen archivieren \\r\\n\\\n  --------------------------------------------------------------\\r\\n\\\n  1. Beauftragung durch QA\\r\\n\\\n  INPUT = E-Mail und Datensatz im WIS ca. 4 Monate vor dem Audit-Solltermin\\r\\n\\\n  In der \\\"Beauftragung\\\" und dem \\\"Kundenstammblatt\\\"   sind alle relevanten Unternehmensinfos enthalten. \\r\\n\\\n  \\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  Mit dem Kunden ist umgehend Kontakt aufzunehmen und ein Termin zu finden (zumindest auf die Woche eingeschr\\xC3\\xA4nkt). Das Stammdatenblatt muss mitgesendet und zur\\xC3\\xBCck gefordert werden.\\r\\n\\\n  Weiters sind seine Auditw\\xC3\\xBCnsche zu erheben (bzw. zumindest ihn darauf hinzuweisen)\\r\\n\\\n  \\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  Der vom Kunden genannte Termin ist ins WIS einzutragen (+ alle weiters geforderten Informationen -> CO-Auditor, Beobachter, Kundenstammblatt)\\r\\n\\\n  \\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  Ca. 4 Wochen vor dem Audit ist das Auditprogramm zu erstellen und dem Kunden zu senden (Auditpartner eintragen, \\xC3\\x84nderungen /  Erg\\xC3\\xA4nzungen usw)\\r\\n\\\n  \\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  Im WIS bereitgestellte Auditdokumente ausdrucken und in der Auditmappe je register ablegen\\r\\n\\\n  Auditcheckliste ninden und ebenfalls in Auditmappe einordnen.\\r\\n\\\n  Schreibunterlagen + Visitenkarten mitnehmen (rote QA-Tasche)\\r\\n\\\n  \\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  gem. Regelungen der QA\\r\\n\\\n  \\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  Innerhalb von 2 Wochen muss der Auditbericht erstellt werden.\\r\\n\\\n  \\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  je Auditart im WIS upzuloadente Dokumente erstellen, einscannen und uploaden\\r\\n\\\n  \\r\\n\\\n  9. Auditunterlagen archivieren \\r\\n\\\n  Ablage aller papierdokum,ente im Kundenordner (gelb).\\r\\n \\r\\n\\\n  \\r\\n\\\n  \\r\\n\"\n'),(113,'BusinessProcess',6,'update','2','--- \nname: Beratungs- und Dienstleistungsangebot\ncompany_id: 3\nparent_id: \nancestry: \"7\"\npurpose: \"Sicherstellung der einwandfreien Erbringung der Beratungs- und Dienstleistungen zur v\\xC3\\xB6lligen Kundenzufriedenheit und wirtschaftlich erfolgreichen Unternehmensf\\xC3\\xBChrung\"\nnumber: \"\"\nowner_id: 2\naims: Gewinn erwirtschaften\nprocess_class_id: 2\ndescription: \"\"\ncreated_at: 2012-10-04 06:51:07 Z\nupdated_at: 2012-10-13 15:27:11 Z\nx: 650\ny: 300\ncreated_by: \nupdated_by: 2\narea: Leistungserbringung\nid: 6\n','2013-02-18 16:36:50','--- !map:ActiveSupport::HashWithIndifferentAccess \nnumber: \n- \"\"\n- \"2.1\"\ndescription: \n- \"\"\n- \"1) Kundenakqisition\\r\\n\\\n  2) Angebote\\r\\n\\\n  3) Auftragsabwicklung\\r\\n\\\n  4) \"\n'),(114,'User',1,'update',NULL,'--- \nemail: stefan.haslinger@mittenin.at\nencrypted_password: $2a$10$3L45lBdKevWJbdMB67Ll6eMfPkb5xJoge9zcDZDkd7c0AR67DDstC\nreset_password_token: \nreset_password_sent_at: \nremember_created_at: \nsign_in_count: 59\ncurrent_sign_in_at: 2013-01-24 07:35:14 