s und Fortbestand)\"\nprocess_class_id: 1\ndescription: \"h3. Strategie\\r\\n\\\n  \\r\\n\\\n  * Planung \\r\\n\\\n  ** n\\xC3\\xB6tiger Umsatz auf Basis Kosten\\r\\n\\\n  ** Leistungen \\r\\n\\\n  ** Kunden\\r\\n\\\n  ** Weiterbildung\\r\\n\\\n  ** Personal\\r\\n\\\n  \\r\\n\\\n  (inkl. Finanzplanung) --> Anf. GJ\\r\\n\\\n  \\r\\n\\\n  Zus\\xC3\\xA4tzlich zu den SOLL-Grenzen werden Warngrenzen (SOLL + 10 %)- und Eingriffsgrenzen (SOLL + 3%) definiert \\r\\n\\\n  \\r\\n\\\n  * Freigabe\\r\\n\\\n  \\r\\n\\\n  h3. Monitoring + Reporting\\r\\n\\\n  \\r\\n\\\n  * am Quartalsende SOLL - IST-Vergleich \\r\\n\\\n  \\r\\n\\\n  h4. Ma\\xC3\\x9Fnahmen\\r\\n\\\n  \\r\\n\\\n  * --> bei Unterschreitung der Warngrenze --> Vorbeugungsma\\xC3\\x9Fnahme\\r\\n\\\n  * --> bei Unterschreitung der Eingriffsgrenze --> Korrekturma\\xC3\\x9Fnahme\\r\\n\\\n  \\r\\n\"\ncreated_at: 2012-10-02 14:20:36 Z\nupdated_at: 2012-10-07 07:31:20 Z\nx: 475\ny: 200\ncreated_by: \nupdated_by: \narea: \nid: 1\n','2013-02-20 13:49:42','--- !map:ActiveSupport::HashWithIndifferentAccess \nx: \n- 475\n- 471\n'),(133,'User',1,'update','1','--- \nemail: stefan.haslinger@mittenin.at\nencrypted_password: $2a$10$3L45lBdKevWJbdMB67Ll6eMfPkb5xJoge9zcDZDkd7c0AR67DDstC\nreset_password_token: \nreset_password_sent_at: \nremember_created_at: 2013-02-20 10:47:47 Z\nsign_in_count: 67\ncurrent_sign_in_at: 2013-02-20 13:43:57 Z\nlast_sign_in_at: 2013-02-20 10:47:47 Z\ncurrent_sign_in_ip: 178.191.172.170\nlast_sign_in_ip: 91.115.173.188\npassword_salt: \ncreated_at: 2012-09-13 08:32:15 Z\nupdated_at: 2013-02-20 13:43:57 Z\nfirstname: Stefan\nlastname: Testsystem\nparent_id: \nancestry: \nid: 1\n','2013-02-20 13:53:25','--- !map:ActiveSupport::HashWithIndifferentAccess \nremember_created_at: \n- 2013-02-20 10:47:47 Z\n- \n'),(134,'User',1,'update',NULL,'--- \nemail: stefan.haslinger@mittenin.at\nencrypted_password: $2a$10$3L45lBdKevWJbdMB67Ll6eMfPkb5xJoge9zcDZDkd7c0AR67DDstC\nreset_password_token: \nreset_password_sent_at: \nr