fferentAccess \nlast_sign_in_at: \n- 2013-02-20 20:07:48 Z\n- &id001 2013-02-21 16:56:29 Z\ncurrent_sign_in_at: \n- *id001\n- 2013-02-22 07:56:31.887091 Z\nlast_sign_in_ip: \n- 178.191.172.170\n- 194.166.106.33\nsign_in_count: \n- 70\n- 71\n'),(145,'BusinessProcess',32,'update','1','--- \nname: \"T\\xC3\\xA4tigkeit f\\xC3\\xBCr die Quality Austria\"\ncompany_id: 3\nparent_id: \nancestry: \"7\"\npurpose: \"Einwandfreie Durchf\\xC3\\xBChrung und Erf\\xC3\\xBCllung der Auftr\\xC3\\xA4ge der Quality Austria \"\nnumber: \"1.1\"\nowner_id: 2\naims: \"termingerechte und richtige Erf\\xC3\\xBCllung der Auftr\\xC3\\xA4ge der Quality Austria\"\nprocess_class_id: 2\ndescription: \"1. Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  9. Auditunterlagen archivieren \\r\\n\\\n  --------------------------------------------------------------\\r\\n\\\n  1. Beauftragung durch QA\\r\\n\\\n  INPUT = E-Mail und Datensatz im WIS ca. 4 Monate vor dem Audit-Solltermin\\r\\n\\\n  In der \\\"Beauftragung\\\" und dem \\\"Kundenstammblatt\\\"   sind alle relevanten Unternehmensinfos enthalten. \\r\\n\\\n  \\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  Mit dem Kunden ist umgehend Kontakt aufzunehmen und ein Termin zu finden (zumindest auf die Woche eingeschr\\xC3\\xA4nkt). Das Stammdatenblatt muss mitgesendet und zur\\xC3\\xBCck gefordert werden.\\r\\n\\\n  Weiters sind seine Auditw\\xC3\\xBCnsche zu erheben (bzw. zumindest ihn darauf hinzuweisen)\\r\\n\\\n  \\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  Der vom Kunden genannte Termin ist ins WIS einzutragen (+ alle weiters geforderten Informationen -> CO-Auditor, Beobachter, Kundenstammblatt)\\r\\n\\\n  \\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  Ca. 4 Wochen vor dem Audit ist das Auditprogramm zu erstellen und dem Kunden zu senden (Auditpartner eintragen, \\xC3\\x84nderungen /  Erg\\xC3\\xA4nzungen usw)\\r\\n\\\n  \\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  Im WIS bereitgestellte Auditdokumente ausdrucken und in der Auditmappe je register ablegen\\r\\n\\\n  Auditcheckliste ninden und ebenfalls in Auditmappe einordnen.\\r\\n\\\n  Schreibunterlagen + Visitenkarten mitnehmen (rote QA-Tasche)\\r\\n\\\n  \\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  gem. Regelungen der QA\\r\\n\\\n  \\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  Innerhalb von 2 Wochen muss der Auditbericht erstellt werden.\\r\\n\\\n  \\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  je Auditart im WIS upzuloadente Dokumente erstellen, einscannen und uploaden\\r\\n\\\n  \\r\\n\\\n  9. Auditunterlagen archivieren \\r\\n\\\n  Ablage aller papierdokum,ente im Kundenordner (gelb).\\r\\n \\r\\n\\\n  \\r\\n\\\n  \\r\\n\"\ncreated_at: 2012-10-13 15:20:54 Z\nupdated_at: 2013-02-18 15:53:04 Z\nx: 650\ny: 250\ncreated_by: 2\nupdated_by: 2\narea: Consulting\nid: 32\n','2013-02-22 08:04:49','--- !map:ActiveSupport::HashWithIndifferentAccess \nupdated_by: \n- 2\n- 1\ndescription: \n- \"1. Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  9. Auditunterlagen archivieren \\r\\n\\\n  --------------------------------------------------------------\\r\\n\\\n  1. Beauftragung durch QA\\r\\n\\\n  INPUT = E-Mail und Datensatz im WIS ca. 4 Monate vor dem Audit-Solltermin\\r\\n\\\n  In der \\\"Beauftragung\\\" und dem \\\"Kundenstammblatt\\\"   sind alle relevanten Unternehmensinfos enthalten. \\r\\n\\\n  \\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  Mit dem Kunden ist umgehend Kontakt aufzunehmen und ein Termin zu finden (zumindest auf die Woche eingeschr\\xC3\\xA4nkt). Das Stammdatenblatt muss mitgesendet und zur\\xC3\\xBCck gefordert werden.\\r\\n\\\n  Weiters sind seine Auditw\\xC3\\xBCnsche zu erheben (bzw. zumindest ihn darauf hinzuweisen)\\r\\n\\\n  \\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  Der vom Kunden genannte Termin ist ins WIS einzutragen (+ alle weiters geforderten Informationen -> CO-Auditor, Beobachter, Kundenstammblatt)\\r\\n\\\n  \\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  Ca. 4 Wochen vor dem Audit ist das Auditprogramm zu erstellen und dem Kunden zu senden (Auditpartner eintragen, \\xC3\\x84nderungen /  Erg\\xC3\\xA4nzungen usw)\\r\\n\\\n  \\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  Im WIS bereitgestellte Auditdokumente ausdrucken und in der Auditmappe je register ablegen\\r\\n\\\n  Auditcheckliste ninden und ebenfalls in Auditmappe einordnen.\\r\\n\\\n  Schreibunterlagen + Visitenkarten mitnehmen (rote QA-Tasche)\\r\\n\\\n  \\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  gem. Regelungen der QA\\r\\n\\\n  \\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  Innerhalb von 2 Wochen muss der Auditbericht erstellt werden.\\r\\n\\\n  \\r\\n\\\n  8. relevante Dokumente ins WIS hochladen\\r\\n\\\n  je Auditart im WIS upzuloadente Dokumente erstellen, einscannen und uploaden\\r\\n\\\n  \\r\\n\\\n  9. Auditunterlagen archivieren \\r\\n\\\n  Ablage aller papierdokum,ente im Kundenordner (gelb).\\r\\n \\r\\n\\\n  \\r\\n\\\n  \\r\\n\"\n- \"# Beauftragung durch QA (via WIS)\\r\\n\\\n  2. Terminkoordination mit dem Kunden\\r\\n\\\n  3. Terminr\\xC3\\xBCckmeldung an QA (im WIS)\\r\\n\\\n  4. Auditprogramm erstellen\\r\\n\\\n  5. Auditmappe erstellen (gem. WIS)\\r\\n\\\n  6. Audit durchf\\xC3\\xBChren\\r\\n\\\n  7. Auditbericht erstellen\\r\\n\\\n  8. relevante Dokumente ins WIS