\nancestry: \'7\'\npurpose: ges. Finanzmanagement sicherstellen\nnumber: \'\'\nowner_id: 2\naims: Liquidität sicherstellen, Unternehmensfortbestand sichern\nprocess_class_id: 9\ndescription: ! \"Finanzplanung (Bedarf)\\r\\nLiquiditätsplanung\\r\\nRechnungswesen \\r\\nMahnwesen\\r\\nSteuerberater\\r\\nFinanzamt\n  / Behörden\"\ncreated_at: 2012-10-04 06:42:23.000000000 Z\nupdated_at: 2012-10-13 15:27:16.000000000 Z\nx: 700\ny: 200\ncreated_by: \nupdated_by: \narea: \nid: 4\n','2013-06-06 11:47:16','--- !ruby/hash:ActiveSupport::HashWithIndifferentAccess\nx:\n- 700\n- 250\ny:\n- 200\n- 25\n'),(227,'BusinessProcess',5,'update','1','---\nname: Ressourcen\ncompany_id: 3\nparent_id: \nancestry: \'7\'\npurpose: Sicherstellung der Verfügbarkeit aller nötigen Ressourcen\nnumber: \'\'\nowner_id: 2\naims: alloe nötigen Ressourcen sind verfügbar bzw. die Planung und Beschaffung dieser\n  Ressourcen ist klargstellt\nprocess_class_id: 1\ndescription: ! \"*Personelle Ressourcen*\\r\\n * Rekrutierung\\r\\n * Anstellung\\r\\n *\n  Beschäftigung \\r\\n * Aus- und Weiterbildung\\r\\n * Beendigung der Beschäftigung\\r\\n\\r\\n*Sachressourcen*\\r\\n\n  * Planung\\r\\n * Anschaffung\\r\\n * Verwendung\\r\\n * Instandhaltung\\r\\n * Beendigung\n  der Verwendung / Ausscheiden\\r\\n\\r\\n*Infrastruktur / Arbeitsumgebung*\"\ncreated_at: 2012-10-04 06:46:58.000000000 Z\nupdated_at: 2013-02-15 08:24:37.000000000 Z\nx: 900\ny: 200\ncreated_by: \nupdated_by: \narea: \nid: 5\n','2013-06-06 11:47:18','--- !ruby/hash:ActiveSupport::HashWithIndifferentAccess\nx:\n- 900\n- 425\ny:\n- 200\n- 25\n'),(228,'BusinessProcess',32,'update','1','---\nname: Tätigkeit für die Quality Austria\ncompany_id: 3\nparent_id: \nancestry: \'7\'\npurpose: ! \'Einwandfreie Durchführung und Erfüllung der Aufträge der Quality Austria \'\nnumber: \'1.1\'\nowner_id: 2\naims: termingerechte und richtige Erfüllung der Aufträge der Quality Austria\nprocess_class_id: 2\ndescription: ! \"1. Beauftragung durch QA (via WIS)\\r\\n2. Terminkoordination mit dem\n  Kunden\\r\\n3. Terminrückmeldung an QA (im WIS)\\r\\n4. Auditprogramm erstellen\\r\\n5.\n  Auditmappe erstellen (gem. WIS)\\r\\n6. Audit durchführen\\r\\n7. Auditbericht erstellen\\r\\n8.\n  relevante Dokumente ins WIS hochladen\\r\\n9. Auditunterlagen archivieren \\r\\n--------------------------------------------------------------\\r\\n1.\n  Beauftragung durch QA\\r\\nINPUT = E-Mail und Datensatz im WIS ca. 4 Monate vor dem\n  Audit-Solltermin\\r\\nIn der \\\"Beauftragung\\\" und dem \\\"Kundenstammblatt\\\"   sind\n  alle relevanten Unternehmensinfos enthalten. \\r\\n\\r\\n2. Terminkoordination mit dem\n  Kunden\\r\\nMit dem Kunden ist umgehend Kontakt aufzunehmen und ein Termin zu finden\n  (zumindest auf die Woche eingeschränkt). Das Stammdatenblatt muss mitgesendet und\n  zurück gefordert werden.\\r\\nWeiters sind seine Auditwünsche zu erheben (bzw. zumindest\n  ihn darauf hinzuweisen)\\r\\n\\r\\n3. Terminrückmeldung an QA (im WIS)\\r\\nDer vom Kunden\n  genannte Termin ist ins WIS einzutragen (+ alle weiters geforderten Informationen\n  -> CO-Auditor, Beobachter, Kundenstammblatt)\\r\\n\\r\\n4. Auditprogramm erstellen\\r\\nCa.\n  4 Wochen vor dem Audit ist das Auditprogramm zu erstellen und dem Kunden zu senden\n  (Auditpartner eintragen, Änderungen /  Ergänzungen usw)\\r\\n\\r\\n5. Auditmappe erstellen\n  (gem. WIS)\\r\\nIm WIS bereitgestellte Auditdokumente ausdrucken und in der Auditmappe\n  je register ablegen\\r\\nAuditcheckliste ninden und ebenfalls in Auditmappe einordnen.\\r\\nSchreibunterlagen\n  + Visitenkarten mitnehmen (rote QA-Tasche)\\r\\n\\r\\n6. Audit durchführen\\r\\ngem. Regelungen\n  der QA\\r\\n\\r\\n7. Auditbericht erstellen\\r\\nInnerhalb von 2 Wochen muss der Auditbericht\n  erstellt werden.\\r\\n\\r\\n8. relevante Dokumente ins WIS hochladen\\r\\nje Auditart\n  im WIS upzuloadente Dokumente erstellen, einscannen und uploaden\\r\\n\\r\\n9. Auditunterlagen\n  archivieren \\r\\nAblage aller papierdokum,ente im Kundenordner (gelb).\\r\\n \\r\\n\\r\\n\\r\\n\"\ncreated_at: 2012-10-13 15:20:54.000000000 Z\nupdated_at: 2013-02-22 08:05:02.000000000 Z\nx: 650\ny: 250\ncreated_by: 2\nupdated_by: 1\narea: Consulting\nid: 32\n','2013-06-06 11:47:20','--- !ruby/hash:ActiveSupport::HashWithIndifferentAccess\nx:\n- 650\n- 250\ny:\n- 250\n- 75\n'),(229,'BusinessProcess',6,'update','1','---\nname: Beratungs- und Dienstleistungsangebot\ncompany_id: 3\nparent_id: \nancestry: \'7\'\npurpose: Sicherstellung der einwandfreien Erbringung der Beratungs- und Dienstleistungen\n  zur völligen Kundenzufriedenheit und wirtschaftlich erfolgreichen Unternehmensführung\nnumber: \'2.1\'\nowner_id: 2\naims: Gewinn erwirtschaften\nprocess_class_id: 2\ndescription: ! \"1) Kundenakqisition\\r\\n2) Angebote\\r\\n3) Auftragsabwicklung\\r\\n4) \"\ncreated_at: 2012-10-04 06:51:07.000000000 Z\nupdated_at: 2013-02-18 16:36:50.000000000 Z\nx: 650\ny: 300\ncreated_by: \nupdated_by: 2\narea: Leistungserbringung\nid: 6\n','2013-06-06 11:47:21','--- !ruby/hash:ActiveSupport::HashWithIndifferentAccess\nx:\n- 650\n- 250\ny:\n- 300\n- 150\n'),(230,'BusinessProcess',5,'update','1','---\nname: Ressourcen\ncompany_id: 3\nparent_id: \nancestry: \'7\'\npurpose: Sicherstellung der Verfügbarkeit aller nötigen Ressourcen\nnumber: \'\'\nowner_id: 2\naims: alloe nötigen Ressourcen sind verfügbar bzw. die Planung und Beschaffung dieser\n  Ressourcen ist klargstellt\nprocess_class_id: 1\ndescription: ! \"*Personelle Ressourcen*\\r\\n * Rekrutierung\\r\\n * Anstellung\\r\\n *\n  Beschäftigung \\r\\n * Aus- und Weiterbildung\\r\\n * Beendigung der Beschäftigung\\r\\n\\r\\n*Sachressourcen*\\r\\n\n  * Planung\\r\\n * Anschaffung\\r\\n * Verwendung\\r\\n * Instandhaltung\\r\\n * Beendigung\n  der Verwendung / Ausscheiden\\r\\n\\r\\n*Infrastruktur / Arbeitsumgebung*\"\ncreated_at: 2012-10-04 06:46:58.000000000 Z\nupdated_at: 2013-06-06 11:47:18.000000000 Z\nx: 425\ny: 25\ncreated_by: \nupdated_by: \narea: \nid: 5\n','2013-06-06 11:47:2